In the code, we discussed about the program, The id value is private because no other processor can use the id or make changes in it. The "QuickFind" method, we intialize the array and assign values respectively. The another method is "find" , we pass an argument .so, we return the id value of that particular argument. In the another method "Union", we pass two arguments p, q and assign two integers with the id of the passing arguments. Then, iterate for each and every single element, check if id number of the passing argument is same as the assigned value.i.e., int pid = id[p]. If the condition is satisfied then, the id value is changed.i.e., id[i] = qid.
The number of components vary with the program inputs.

public class QuickFind
{
private int[] id;
public QuickFind(int N)
{
 id = new int[N];
for (int i = 0; i < N; i++){
id[i] = i;
}
}
public boolean find(int p, int q)
{
return id[p] == id[q];
}
public void union(int p, int q)
{
int pid = id[p];
for (int i = 0; i < id.length; i++){
if (id[i] == pid){
id[i] = id[q];
}
}

}
}

